import React from "react";
import ConfigFooter from '../capas/footer/footer';
import ConfigHead from '../capas/head/head';
import  Cv from '../componentes/cv.jpg';
import  Cvingles from '../componentes/cvingles.jpg';

const Curriculum = () => {
    return(
    <>
        <ConfigHead/>
        <div >
            <div className="lineaProyecto">
                <h3 className="proyecto">Proyecto Front <a className="flechafront"href="https://github.com/pdepjm/2021-o-tpi-juego-e35ms">➤</a></h3>
                </div> 
                 <img className="imagenes" src={Cv} alt="projecto"></img>
                </div> 
                <div className="proyectito">
            <div className="lineaProyecto">
                <h3 className="proyecto">Proyecto Front <a className="flechafront"href="https://github.com/pdepjm/2021-o-tpi-juego-e35ms">➤</a></h3>
                </div> 
                 <img className="imagenes" src={Cvingles} alt="projecto"></img>
                </div> 
        <ConfigFooter/>
    </>
    )
};

export default Curriculum;
